import React from 'react';
import './componentes.scss';
import tileData from './tileData';

const Productos = () =>{
const Productos = tileData.map((pro, i) => <div key={i}> {pro.title} {pro.author}</div>)
return(
        <table>
        <tbody>
        {Productos}
        </tbody>
        </table>
)
}

export default Productos
